import React from 'react';
import './App.css'; // Import your CSS file
import busImage from './images/busOne.jpg'; // Import or specify the path to your background image
import './ProfessionalWebsite.css'; // Custom CSS for the professional website

function signUp() {
  alert('You clicked me!');
}

function Gallery() {
  const imageSectionStyle = {
    background: `url(${busImage})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
    opacity: 0.9, // Adjust the opacity (0.0 to 1.0)
  };

  const containerStyle = {
    backgroundColor: '#D2B0D0',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    color: 'white', // Text color
  };

  return (
    <div className="container" style={containerStyle}>
      <div style={imageSectionStyle} className="image-section">
        {/* Image section with background */}
        <h1 className="header">Welcome to UW Bus Buddies - Connecting Commuters!</h1>
      </div>
      <div className="text-section">
        <p className="paragraph">Join us to find your commuting buddy.</p>
        <h2 className="header">Who We Are</h2>
        <p className="paragraph">We are...</p>
        <h2 className="header">Join Us</h2>
        <button onClick={signUp} className="btn btn-primary">Sign Up</button>
      </div>
    </div>
  );
}

export default Gallery;
